          <p>{data.description}</p>
          <div className="bottom">
            <div className="options">
              <Link className="btn-reset btn">Ver MÃ¡s</Link>
              <Link className="btn-reset btn">Descargar</Link>
            </div>
            <span className="date">{setDateFormat(data.createdAt)}</span>
          </div>
        </div>
      </div>
    </>
  );
}
